import React, { useState, useEffect } from "react";
import { useNavigate } from "react-router-dom";

const Billing = () => {
    const auth = localStorage.getItem('user');
    const vehicleData = localStorage.getItem('vehicleDetails');
    const book = localStorage.getItem('bookingData');
    // const online = localStorage.getItem('onlinePay');
    // const onlinePay = JSON.parse(online);
    const vehicle = JSON.parse(vehicleData);
    const bookingData = JSON.parse(book);
    // const b_amt = bookingData.totalRent;
    // console.log(bookingData);
    const [b_amt, setB_amt] = useState('');
    if ((bookingData.payment === 'cash')) {
        setB_amt(bookingData.totalRent);
    }
    // console.log(b_amt);
    // console.log(category);
    // setB_amt(bookingData.totalRent);
    const navigate = useNavigate();
    useEffect(() => {
        if (!auth) {
            navigate('/login');
            // alert("You are not Login !");
        }


    });





    return (
        <div>
            <div className="mt-20 inline-grid">
                <h2> Your Booking Details</h2>

                <div className="grid grid-cols-3 gap-6 w-screen  mt-5 ">
                    <div className="col-span-1 ">
                        <h2 className="text-start ml-2 text-xl">Mr/Mrs <span className="font-semibold">{JSON.parse(auth).name}</span>, </h2>
                        <p className="text-lg text-right">Hello,<span className=" font-bold"> Mr/Mrs.{JSON.parse(auth).name}</span> thank you choosing our organization for Rent. We will give free <span className=" font-bold">Deriver</span> for <span className=" font-bold">{vehicle.category}</span> . If you want to book {vehicle.category} click on <samp className=" font-bold"> Ok </samp> otherwise click on <samp className=" font-bold"> Cancel </samp> </p>
                    </div>
                    <div className="font-bold inline-grid col-span-1 mx-9 ">
                        <h4 className=" text-center">Book Details</h4>
                        <table className='border-collapse border border-slate-950 my-4 '>
                            <tbody className=" text-center my-2">
                                <tr className=" mt-3">
                                    <td>Rent Price (per day) :</td>
                                    <td>NRs. {vehicle.price}</td>
                                </tr>
                                <tr>
                                    <td>Rent Day(s) : </td>
                                    <td>{bookingData.days}</td>
                                </tr>
                                <tr>
                                    <td>Vehicle Quntity : </td>
                                    <td>{bookingData.v_quantity}</td>
                                </tr>
                                <tr>
                                    <td colSpan="2" style={{ borderBottom: "1px solid black" }}></td>
                                </tr>
                                <tr>
                                    <td>Total Rent Price : </td>
                                    <td>NRs. {bookingData.totalRent}</td>
                                </tr>
                            </tbody>
                        </table>
                    </div>

                    <div className="font-bold inline-grid col-span-1 mx-9 ">
                        <h4 className=" text-center">Bill Details</h4>
                        <table className='border-collapse border border-slate-950 my-4 '>
                            <tbody className=" text-center my-2">
                                <tr className=" mt-3">
                                    <td>Rent Price (per day) :</td>
                                    <td>NRs. {vehicle.price}</td>
                                </tr>
                                <tr>
                                    <td>Rent Day(s) : </td>
                                    <td>{bookingData.days}</td>
                                </tr>
                                <tr>
                                    <td>Vehicle Quntity : </td>
                                    <td>{bookingData.v_quantity}</td>
                                </tr>
                                <tr>
                                    <td colSpan="2" style={{ borderBottom: "1px solid black" }}></td>
                                </tr>
                                <tr>
                                    <td>Total Rent Price : </td>
                                    <td>NRs. {bookingData.totalRent}</td>
                                </tr>
                                <tr>
                                    <td colSpan="2" style={{ borderBottom: "1px solid black" }}></td>
                                </tr>
                                <tr>
                                    <td>Payment :</td>
                                    <td>{bookingData.payment}</td>
                                </tr>
                                <tr>
                                    <td>Bill Amount </td>
                                    <td> {b_amt}</td>
                                </tr>
                            </tbody>
                        </table>
                    </div>
                </div>
            </div>
        </div>
    )
}

export default Billing;
